import React from "react";
import { Line } from "react-chartjs-2";
import { BalanceStats as Statistics } from "../../styledComponents/Dashboard/BalanceStats";
const BalanceStats = () => {
  return (
    <Statistics>
      Balance Statistics
      <Line
        data={{
          labels: ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"],
          datasets: [
            {
              label: "Transaction",
              data: [1, , , 5, 2, 3, 5],
            },
          ],
        }}
        height={100}
        width={200}
      />
    </Statistics>
  );
};
export default BalanceStats;
